import React from "react";

export function TacOpsList({ data }) {
  return (
    <div>
      {data.base.map((category) => (
        <React.Fragment key={category.title}>
          <div>{category.title}</div>
          <ul>{category.ops.map((op) => op.title)}</ul>
        </React.Fragment>
      ))}
    </div>
  );
}
